def makeFloorPlanList(jsonPlan):
    pyFloorPlan = json.loads(jsonPlan)
    floorPlanList = pyFloorPlan["floorPlans"]
    return floorPlanList

#Return just a list of walls, sort through them and organize them into their size group in group walls.
def getWalls(type):
    #TODO handle if there are two walls of corrected. 
    floorPlanList = makeFloorPlanList(jsonFloorPlan)
    wallsList = []
    for floor in floorPlanList:
        if floor["type"] == type:
            orthoWalls = floor["walls"]
            for wall in orthoWalls:
                wallsList.append(wall["length"])
        elif floor["type"] == type:
            correctedWalls = floor["walls"]
            for wall in correctedWalls:
                wallsList.append(wall["length"])
    worksheet.write('A2', 'Wall Count')
    worksheet.write('B2', len(wallsList))
    print("WallCount")
    print(len(wallsList))
    return wallsList


def getRooms():
    floorPlanList = makeFloorPlanList(jsonFloorPlan)
    roomList = []
    worksheet.write('A1', 'Room Count')

    roomNumber = 1
    for floor in floorPlanList:
        if floor["type"] == "orthorectified":
            rooms = floor["rooms"]
            for room in rooms:
                roomNumber += 1
                roomList.append(room)

    worksheet.write(0, 1, len(roomList))
    print("Room count")
    print(len(roomList))


def displayWalls(walls, row):
    col = 1
    for wall in walls:
        worksheet.write(row, col, wall)
        col += 1
        print(wall)


#Main Functions
def averageDifferenceAndPercentage():

    #loop through raw, ortho, and corrected

    orthoWallsList = getWalls("orthorectified")
    correctWallsList = getWalls("correctedMeasurment")
    totalWalls = len(orthoWallsList) + len(correctWallsList)

    #find and return average difference in meters
    index = 0
    differenceList = []
    wallLengthDifferenceSum = 0
    orthoWallsLengthSum = 0
    if len(orthoWallsList) and len(correctWallsList) > 0:
        print("Ortho")
        worksheet.write('A3', 'Ortho Walls')
        displayWalls(orthoWallsList, 2)
        print("Corrected")
        worksheet.write('A4', 'Corrected Walls')
        displayWalls(correctWallsList, 3)
        for wall in orthoWallsList:
            difference = correctWallsList[index] - wall
            orthoWallsLengthSum += wall
            index += 1
            wallLengthDifferenceSum += difference

        #Average
        averageDiff = wallLengthDifferenceSum / len(orthoWallsList)
        print("Average")
        worksheet.write('A5', 'Average Difference')
        worksheet.write('B5', averageDiff)
        print(averageDiff)

        #Percentage
        percentage = wallLengthDifferenceSum / orthoWallsLengthSum * 100
        worksheet.write('A6', 'Percentage Difference')
        worksheet.write('B6', percentage)
        print("Percentage")
        print(percentage)


